import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function App(props) {
  return (
    <div>
      <Header />
      <Note 
        title={notes.map(x => x.title)}
        content="here is content"
      />
      <Footer />
    </div>
  );
}

export default App;
